// src/pages/MstPemasok/PemasokList.jsx
import { useEffect, useState } from 'react';
import Layout from '../../components/Layout';
import api from '../../axios';
import PemasokForm from './PemasokForm';
import PemasokDetail from './PemasokDetail';

const PemasokList = () => {
  const [data, setData] = useState([]);
  const [selectedPemasok, setSelectedPemasok] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [showDetail, setShowDetail] = useState(false);
  const [editMode, setEditMode] = useState(false);

  const fetchData = async () => {
    const res = await api.get('/api/pemasok');
    setData(res.data);
  };

  useEffect(() => {
    fetchData();
  }, []);

  const handleEdit = (pemasok) => {
    setSelectedPemasok(pemasok);
    setEditMode(true);
    setShowForm(true);
  };

  const handleDetail = (pemasok) => {
    setSelectedPemasok(pemasok);
    setShowDetail(true);
  };

  const handleDelete = async (id) => {
    if (window.confirm('Yakin hapus pemasok ini?')) {
      await api.delete(`/api/pemasok/${id}`);
      fetchData();
    }
  };

  return (
    <Layout>
      <div className="container mt-4">
        <div className="d-flex justify-content-between mb-3">
          <h3>Daftar Pemasok</h3>
          <button
            className="btn btn-primary"
            onClick={() => {
              setShowForm(true);
              setEditMode(false);
              setSelectedPemasok(null);
            }}
          >
            Tambah Pemasok
          </button>
        </div>

        <table className="table table-bordered table-hover">
          <thead className="table-light">
            <tr>
              <th>No Pemasok</th>
              <th>Nama</th>
              <th>Telepon</th>
              <th>Kontak</th>
              <th>Saldo Awal</th>
              <th>Mata Uang</th>
              <th>Aksi</th>
            </tr>
          </thead>
          <tbody>
            {data.map((p) => (
              <tr key={p.id}>
                <td>{p.no_pemasok}</td>
                <td>{p.nama}</td>
                <td>{p.telepon}</td>
                <td>{p.kontak && typeof p.kontak === 'string' ? p.kontak : '-'}</td>

                <td>{p.saldo_awal}</td>
                <td>{p.currency?.name || '-'}</td>
                <td>
                  <button
                    className="btn btn-sm btn-info me-1"
                    onClick={() => handleDetail(p)}
                  >
                    Detail
                  </button>
                  <button
                    className="btn btn-sm btn-warning me-1"
                    onClick={() => handleEdit(p)}
                  >
                    Edit
                  </button>
                  <button
                    className="btn btn-sm btn-danger"
                    onClick={() => handleDelete(p.id)}
                  >
                    Hapus
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>

        {showForm && (
          <PemasokForm
            show={showForm}
            onClose={() => setShowForm(false)}
            editMode={editMode}
            data={selectedPemasok}
            onSuccess={fetchData}
          />
        )}

        {showDetail && (
          <PemasokDetail
            show={showDetail}
            onClose={() => setShowDetail(false)}
            data={selectedPemasok}
          />
        )}
      </div>
    </Layout>
  );
};

export default PemasokList;
